import React from "react";
import { Navigate } from "react-router-dom";
import logo from '..logo.svg';
export default function Logo() {
    return (
<a href='' onClick={() => {
    Navigate(<HomeScreen/>)
}}>
    <img className='logo' src={logo} alt="description" />
</a>
    )
}
